O Dani deu várias dicas das propriedades químicas do carbono, por isso o 
Andy conseguiu adivinhar:
- Em 1:02, quando ele se apresenta: a ligação covalente é uma das 
principais formas pela qual o carbono se liga aos demais átomos;
- Em 1:25, quando ele cumprimenta a galera: o carbono é um dos principais 
átomos na composição dos seres vivos e em grande parte dos materiais;
- Em 1:46, quando ele pede pra fazer ligações: o carbono é um dos átomos 
que pode fazer até 4 ligações covalentes com demais átomos;
- Em 1:58, quando ele liga para o Oxigênio: um dos principais átomos com o 
qual o carbono se relaciona, além de Hidrogênio e Nitrogênio (durante a 
ligação, o Dani também faz comentários sobre o Nitrogênio, em 2:18);
- Em 2:10, ele diz que não falou com o gás nobre: em verdade, gases nobres 
não fazem ligações com nenhum outro átomo (por o gás nobre "nem falava" com 
ele);

Eu não sou químico, se falei alguma bobeira ou se quiserem complementar, 
por favor fiquem a vontade. :)
